import React from "react";
import { Card } from "react-bootstrap";
import pin from "../../assets/icons/pin.svg";
import credit from "../../assets/icons/creditCardPayment.svg";
import cash from "../../assets/icons/cash.svg";
import "./styles.css";

const RestCard = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="container">
          <div className="row">
            <div className="container-fluid">
              <div className="row" className="images_frames">
                <div className="col" className="image_cols">
                  <Card.Img
                    variant="top"
                    src="https://cdn.pixabay.com/photo/2016/12/26/17/28/spaghetti-1932466_960_720.jpg"
                    style={{
                      width: "100%",
                      height: "100%",
                      borderRadius: "10px",
                    }}
                  />
                </div>
              </div>
              <div className="restaurant_type">Comida Corrida</div>
              <div className="name">Fonda Don Jos√©</div>
              <div className="direction">
                <img src={pin}></img>
                Av.Insurgentes sur 322 Col.Valle sur, Del. Benito Juares. CDMX
              </div>
            </div>
            <div className="container-fluid">
              <img src={credit} className="icon-money"></img>
              <img src={cash} className="icon-money"></img>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default RestCard;
